// src/App.js
import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';

// Components
import LandingPage from './components/sections/LandingPage';
import Creator from './components/sections/Creator';
import ComingSoon from './components/sections/ComingSoon';

const App = () => {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<LandingPage />} />
        <Route path="/creator" element={<Creator />} />
        <Route path="/cycles" element={<ComingSoon title="Cycles" description="The evolutionary simulation system for Crescent worlds is coming soon." />} />
        <Route path="/characters" element={<ComingSoon title="Characters" description="The character management system for Crescent is coming soon." />} />
        <Route path="/codex" element={<ComingSoon title="Codex" description="The compendium of Crescent rules and lore is coming soon." />} />
      </Routes>
    </Router>
  );
};

export default App;
